import React, { useState } from 'react'
import Card from './components/Card'

const App = () => {

  const data = [
    {name: "john", profession:"teacher", friends: false, image: "data:image/jpeg;base64,"},
    {name: "mao", profession:"student",friends: false, image: "data:image/jpeg;base64,"},
    {name: "chio", profession:"army",friends: false, image: "data:image/jpeg;base64,"},
    {name: "rutho", profession:"govt agent",friends: false, image: "data:image/jpeg;base64,"}
  ];

  const [realdata, setRealData] = useState(data);
  const handleFriendsButton = (cardindex) => {
    setRealData((prev)=>{
      return prev.map((item,index)=>{
        if(index === cardindex){
          return {...item, friends: !item.friends}
        }
        return item;
      })
    })
  }
  return (
    <>
      <div className='w-full h-screen bg-zinc-300 flex gap-4 items-center justify-center'>
        {realdata.map((item,index)=>(
          <Card key={index} index={index} name={item.name} friends={item.friends} handleFriendsButton={handleFriendsButton} image={item.image} profes={item.profession} />
        ))}
      </div>
    </>
  )
}

export default App